import React, {useState} from 'react';

import TitleScreen from './TitleScreen.js';
import NormalGame from './NormalGame.js';

const FlashMath = () => {
    const [difficulty, setDifficulty] = useState(0);
    const [rem, setRem] = useState(
        <TitleScreen changeRem={(window, parameters) => startGame(window, parameters)} difficulty={difficulty}/>, 
        <NormalGame changeRem={(window, parameters) => startGame(window, parameters)} difficulty={difficulty}/>
        );

    const startGame = (window, parameters) => {
        setParameters(parameters.difficulty);
        setRem(window);
    }

    return (
        <>
            {rem}
        </>
    )
}

export default FlashMath;
